def saver():
    text=txt.get('1.0','end')
    try:    
        img = qrcode.make(text)
        qr = qrcode.QRCode(version=1,error_correction=qrcode.constants.ERROR_CORRECT_H,box_size=10,border=4)
        qr.add_data(text)

        qr.make(fit=True)
        img = qr.make_image(fill_color="black", back_color="white")
        img=img.resize((190,190),resample=0)
            

        photo = PIL.ImageTk.PhotoImage(img)
        label = Label(top,image=photo)
        label.image = photo
        label.place(x=40,y=40)
    except:
        pass

    filename =  filedialog.asksaveasfilename(initialdir = "/",title = "Save file",filetypes = (("PNG files","*.png"),("all files","*.*")))
    img.save(filename+".png", format="PNG")
    warn.config(text="Image Saved to the\ndesired path")

